(3, 1, NULL, 4, 'Day 0: From San Jose to Miami to London', 'day-0-from-san-jose-to-miami-to-london-ul', '', 'Got up at 3am to go to the airport. Mami and Priscilla got up to say goodbye. Taxi got there early since\r\nwe called to confirm this time instead of hoping for the best.\r\n\r\nEverything went smoothly. Lots of people in the Miami airport. Flight to London was also smooth and uneventful.\r\nGot a nice look at London and England from the air on arrival. Bought subway tickets for 8 pounds each direct on\r\nthe Picadilly line to Picadilly Circus. Found hostel which was really close to the stop. The hostel was a circus\r\nwith some weird africans running security and other stuff. Great location but the hostel was primitive and the\r\nshared bathrooms were awkward.', 2, 4, NULL, 0, 1, 1, 0, '2010-04-05', '2018-06-03 06:01:14', '2018-06-12 08:56:58'),
(4, 1, NULL, NULL, 'My Big Euro Trip 2010', 'my-big-euro-trip-2010', '20+ Countries in Europe with side trips to Turkey and Egypt.', 'These are notes from my big trip around Europe in 2010.  These are notes from my big trip around Europe in 2010.  These are notes from my big trip around Europe in 2010.', 2, 3, NULL, 0, 1, 1, 0, NULL, '2018-06-03 06:01:22', '2018-06-16 21:02:34'),
