(13, 1, NULL, 4, 'Day 1: Touring around London', 'day-1-touring-around-london-2010-04-06', '', 'Got our room and then took a walk to Buckingham Palace and saw some horse guards. Tons of tourists around.\r\nI needed a bathroom so ended up eating at Pizza Hut. \r\n\r\nWent back to the room since we were still exhausted from the flight and the time change and took a nap from 1 to 3pm.\r\n\r\nLater took a tram to find Madam Toussod\'s and went on in since it was late and there wasn\'t much of a line. Took lots of pics with the wax figures and Kattie loved it. \r\n\r\nWent back to Picadilly and had a beer in a bar close by. Went to another bar, Devonshire Inn, right by the hostel and had some Newcastles and bar food for dinner.', 2, 4, NULL, 0, 1, 1, 0, '2010-04-06', '2018-06-07 19:43:06', '2018-06-12 08:56:51'),
