(14, 1, NULL, 4, 'Day 78: Paris to London on the Chunnel Train', 'day-78-paris-to-london-on-the-chunnel-train-2010-06-23', '', 'Left for the train station at 11am and barely made it on the train because of all the security and check-in procedures. We thought it would be like a regular international train but it was just like going through the airport.\r\n\r\nGot to London, got cash, bought Oyster cards for a week of public transport and then went to Welleston Green and called the hotel people to pick us up. The hotel turned out to be a cozy, little studio apartment in an old brownstone building in a nice little neighborhood. The girl who picked us up was from Uruguay and she set us up in the apartment.\r\n\r\nIn the afternoon went to the local supermarket to buy dinner of instant spicy Indian food in boxes.', 2, 4, NULL, 0, 1, 1, 1, '2010-06-23', '2018-06-08 04:50:55', '2018-06-14 02:49:20'),
(15, 1, NULL, 4, 'Day 3: Good Stuff', 'day-3-good-stuff-2010-04-08', '', 'Stuff Happened', 2, 4, NULL, 0, 1, 1, 0, '2010-04-08', '2018-06-08 04:52:41', '2018-06-09 04:16:02'),
(16, 1, NULL, NULL, 'Day 14: Stockhold to Helsinki by Overnight Ferry', 'day-14-stockhold-to-helsinki-by-overnight-ferry-2010-04-19', '', 'Checked out of the hotel and put our luggage in hotel storage. Took the subway to downtown for a final look around.\r\n\r\nBought final souvenirs and had lunch at a British place.  Lunch was a delicious piece of chicken swaddled in bacon, and potatos with a cheese and wine sauce.\r\n\r\nKate made a final stop at H&M to buy some tennis shoes. Then we took subway back to the hotel to pick up the bags. Walked the 500m or so back to subway with all of our stuff and went to the ferry bus stop that we had found earlier. Lots of people on the bus and at the ferry terminal. The ferry was super efficient and we went right on board. It was a huge ferry, just like a little cruise ship with restaurants, bars, casino, entertainment, circus, pool/sauna, etc.\r\n\r\nPut out stuff in the room which was at the very bottom of the boat, under the car decks, and then went on deck outside to watch the departure from Stockholm. Later we found a couch with a big window so sat there for a few hours and watched the excellent scenery. The boat stayed really close to the bank and there were houses and villages all along the waterfront.\r\n\r\nAfter dark we went and watched a highwire circus act that was above the main promenade and then had a few beers in a bar with live music. After that went to dinner and had some pasta and more beer, Lapin-something. The cabin was cozy with a bathroom and shower and two upper bunk beds. We started in the same bed but they were about half the size of a twin bed so I moved to the other bunk a little later.', 2, 4, NULL, 0, 0, 0, 1, '2010-04-19', '2018-06-08 06:32:16', '2018-06-08 06:33:43'),
(17, 1, NULL, 4, 'Day 14: Stockholm to Helsinki by Overnight Ferry', 'day-14-stockholm-to-helsinki-by-overnight-ferry-2010-04-19', '', 'Checked out of the hotel and put our luggage in hotel storage. Took the subway to downtown for a final look around.\r\n\r\nBought final souvenirs and had lunch at a British place. Lunch was a delicious piece of chicken swaddled in bacon, and potatos with a cheese and wine sauce.\r\n\r\nKate made a final stop at H&M to buy some tennis shoes. Then we took subway back to the hotel to pick up the bags. Walked the 500m or so back to subway with all of our stuff and went to the ferry bus stop that we had found earlier. Lots of people on the bus and at the ferry terminal. The ferry was super efficient and we went right on board. It was a huge ferry, just like a little cruise ship with restaurants, bars, casino, entertainment, circus, pool/sauna, etc.\r\n\r\nPut out stuff in the room which was at the very bottom of the boat, under the car decks, and then went on deck outside to watch the departure from Stockholm. Later we found a couch with a big window so sat there for a few hours and watched the excellent scenery. The boat stayed really close to the bank and there were houses and villages all along the waterfront.\r\n\r\nAfter dark we went and watched a highwire circus act that was above the main promenade and then had a few beers in a bar with live music. After that went to dinner and had some pasta and more beer, Lapin-something. The cabin was cozy with a bathroom and shower and two upper bunk beds. We started in the same bed but they were about half the size of a twin bed so I moved to the other bunk a little later.', 2, 4, NULL, 0, 1, 1, 0, '2010-04-19', '2018-06-08 06:35:14', '2018-06-08 06:36:41'),
