(33, 1, NULL, 4, 'Day 70: Day Trip: Nice to Villefranche-sur-Mer, France', 'day-70-day-trip-nice-to-villefranche-sur-mer-france-2010-06-14', NULL, 'Took the train to the next town over, Villefranche-sur-Mer, to go to the beach which we spotted from the train and it looked really calm. The beach was excellent and the water was calm but frigid as usual. There were more topless ladies on this beach.\r\n\r\nVillafranche was very scenic with colorful buildings lined up along the ocean and trailing up the hillside.', 2, 4, NULL, 0, 1, 1, 0, '2010-06-14', '2018-06-13 20:29:42', '2018-06-14 02:48:33'),
(34, 1, NULL, 4, 'Day 71: Scenic Train Trip form Nice to Paris', 'day-71--scenic-train-trip-form-nice-to-paris-2010-06-15', NULL, 'Left the hotel and took all of our gear to the train station. Bus #12 wasn\'t very crowded so we didn\'t have to fight with anybody to get on with all of our stuff. The train to Paris had plenty of luggage storage and we were the first ones into our car so had no headaches with the big suitcase. The French coast and countryside were spectacular with castles, beaches, and lush greenery everywhere.\r\n\r\nGot to Paris and took the RER subway with some help from a friendly guy at the train station. The people often help us without us even asking them as we are trying to figure out the subway maps and signs. The RER is the train and subway system that is beyond the metro subway.\r\n\r\nWe got to the final stop, Rosny Bois Perrier, and had to walk all the way around a mall and cross under a major highway to find the hotel. Luckily I spotted the huge sign on the horizon. \r\n\r\nA half-blind old man from the train was trying to help us and he kept driving by and yelling directions which contradicted what we knew. At one point he was yelling at us and ran right over the corner curb of the sidewalk. He really wanted to help us.\r\n\r\nThe hotel room turned out to be nasty and depressing even though the lobby and the pictures on the internet were nice. We went back to the mall we had passed for dinner at a Mexican place and then Kate found all of her favorite stores.\r\n\r\nLater spent a few hours in the lobby because the WiFi doesn\'t reach our room. We bought our train ticket to London and tried to find a decent hotel for our final week. There were a lot of sketchy people staying at the hotel, Africans, Russians, Middle-easterners as well as backpackers and businesspeople.', 2, 4, NULL, 0, 1, 1, 0, '2010-06-15', '2018-06-14 02:30:36', '2018-06-14 02:30:42'),
