(45, 1, NULL, 4, 'Day 75: Another day seeing the fantastic Sights of Paris', 'day-75--another-day-seeing-the-fantastic-sights-of-paris-2010-06-19', NULL, 'We spent another day seeing the fantastic sights of Paris.  Took a long walk from Gar de Nord to the Grand Palais, the river, and all the way to the Eiffel Tower. \r\n\r\nKate bought a big Eiffel Tower souvenir with flashing lights so she dances around with while the lights are flashing.', 2, 4, NULL, 0, 1, 1, 0, '2010-06-19', '2018-06-18 07:50:31', '2018-06-18 07:50:37'),
