(136, 0, 1, 2, '::1', 1, 'entries', 'add', 'Entry has been added: Day 70: Day Trip: Nice to Villefranche-sur-Mer, France', 'Took the train to the next town over, Villefranche-sur-Mer, to go to the beach which we spotted from the train and it looked really calm. The beach was excellent and the water was calm but frigid as usual. There were more topless ladies on this beach.\r\n\r\nVillafranche was very scenic with colorful buildings lined up along the ocean and trailing up the hillside.', 33, NULL, NULL, NULL, '2018-06-13 20:29:42', '2018-06-13 20:29:42'),
